# frozen_string_literal: true

# reduceの引数の:*は、ブロックに渡された数をそれぞれ乗算する。加算の場合は、:+。めっちゃすっきり
def factorial(n)
  n < 0 ? nil : (1..n).reduce(:*) || 1
end

